●●インポート商品につきまして<br>
当店取り扱いのインポート商品は、ロサンゼルスに事務所をおく正規代理店より直接仕入れをしておりますため、新品・正規品となります。<br>
ご安心して、当店でのお買い物をお楽しみくださいませ。<br><br>



●●色の見え方につきまして<br>
撮影時の照明環境や、お使いのブラウザにより、実際の商品の色味と多少異なる場合がございます。ご了承下さい。<br><br>



